import React from 'react';

const Myform=()=>{
    return(<>

        <form>
        <p>Enter Your Name</p>
        <input type="text" id="name"/>
        <p>Enter Your Roll No</p>
        <input type="text" id="roll"/>
        
        <button>Submit</button>
        </form>


    </>);


}

export default Myform;
